import { useState } from "react";
 
export const Tasks = () => {
    const [tasks, setTask] = useState([{
        id: 1,
        text: 'Docters Appointment',
        day: 'Feb 5th at 2:30pm',
        reminder: true,
    },
    {
        id: 2,
        text: 'Meeting at school',
        day: 'Feb 6th at 2:30pm',
        reminder: true,
    },
    {
        id: 3,
        text: 'Shopping',
        day: 'Feb 5th at 2:30pm',
        reminder: false,
    }])
    
   return (
     <>{
        tasks.map((task) => (
        <h3 key={task.id}>{task.text}</h3>
     ))}</>
   )
 }
 
 export default Tasks;
